import React from 'react';
import '../css/loading.css'; 

const Loading = () => {
  return (
    <div className='loadtitle'>
      <h1>Alliance</h1>
      <div className='loadfoot'>
        <h4>From</h4>
        <h2>Alliance</h2>
        <h4>Software company</h4>
      </div>
    </div>
  );
}

export default Loading;
